import React from 'react';
import web from "../src/images/getstarted.jpg";
import { NavLink } from 'react-router-dom';



const Home = () => {
	return (
		<>
			<Common name="Welcome to About Page" imgsrc={web} visit="/contact" btname="Contact Now" />
		</>
	);
}

export default Home;
